import axios from 'axios';
import Link from 'next/Link';
import Profile from './../components/profile';
import { fade, makeStyles } from '@material-ui/core/styles';
import Cookies from 'js-cookie';

const useStyles = makeStyles((theme) => ({

  box: {

    display: "flex",
    flexDirection: "column",
    justifyContent: "center",
    marginTop: '5%',
    marginLeft: '20%',
    marginRight: '20%',
    textAlign: "center"
  },
  card: {

    display: "flex",
    flexDirection: "column",
    justifyContent: "center",
    marginTop: '5%',
    marginLeft: '20%',
    marginRight: '20%',
    textAlign: "center"
  }
}));

function UserProfile({ user }) {

  const classes = useStyles();

  return (
    <Profile></Profile>
  )
}

const fetchData = async () => await axios.get(`http://localhost:5050/api/auth/user`,  { headers: { 'Content-Type': 'application/json' }, cookies: Cookies.get('auth'), credentials: 'include' })
  .then(res => ({
    user: res.data
  }))
  .catch(() => ({
    error: true,
    wordlist: null,
  }),
  );

export async function getServerSideProps() {

  const user = await fetchData()

  return {

    props: {
      user: user
    }
  }
}


export default UserProfile
